function setInputVal(r,q,o){var p={str:""+o};p.str=r.info.alg_answer||p.str;var n=q-p.str.length,f="";if(n>0){for(var l=0;l<n;l++){f+="0"}p.str=f+p.str}else{p.str=p.str}var m=$("#codeLockWrap input");var i;for(var l=0;l<q;l++){m[l].value=p.str[l];m[l].onfocus=function(){i=this.value;this.value=""};m[l].onblur=function(){if(!this.value){this.value=i}};m[l].onkeyup=function(){this.blur()}}}getCurStr=function(){var h=[];var f=$("#codeLockWrap input");for(var e=0,g=f.length;e<g;e++){h[e]=f[e].value}return h.join("")};